import React, { Component } from 'react';
import CarMake from './CarMake'

class CarMakesList extends Component {

  render() {
    const { makes, inputText } = this.props

    return (
      <div>
        Here are some car makes....
        <ul>
        {
          makes.map((make, id) => {
            return <CarMake key={id} make={make}/>
          })
        }
        </ul>
      </div>
    );
  }

}

export default CarMakesList;
